import {Button, Dropdown} from "react-bootstrap";
import {React} from "react";
import cityList from '../data/cities.json'

export function CityPicker() {
    return (
        <div>
            <h2>Residential Clustering</h2>
            <Dropdown>
                <Dropdown.Toggle id="dropdown-basic">
                    Pick a city
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    {
                        cityList.map

                    }
                    <Dropdown.Item href="/link-picker">Prague</Dropdown.Item>
                    <Dropdown.Item href="/link-picker">Bratislava</Dropdown.Item>
                    <Dropdown.Item href="/link-picker">Warsaw</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
            <br/>
            <Button href={"/"}>Back</Button>
        </div>
    );
}
